import{_ as e,y as n,x as r,W as i}from"./plugin-vue_export-helper.68280688.js";const p='{"title":"Tageordnung f\xFCr den 3.12.2021","description":"","frontmatter":{},"relativePath":"Teamordner/Tagesordnung_2021_21_03.md","lastUpdated":1649311654706}',t={},a=i('<h1 id="tageordnung-fur-den-3-12-2021" tabindex="-1">Tageordnung f\xFCr den 3.12.2021 <a class="header-anchor" href="#tageordnung-fur-den-3-12-2021" aria-hidden="true">#</a></h1><p>Wuppertal</p><ol><li>Stand der Dinge</li><li>OpenSource Lizenzen (Roadmap)</li><li>Besprechung der Milestones (Roadmap)</li><li>FrontEnd-Development mit den Wuppertalern (Roadmap)</li><li>Pr\xE4sentation GitHub Copilot</li><li>Erstellung eines MonoRepos f\xFCr SVWS-Server und SVWS-Client (Diskussion)</li><li>Dokumentation (Arbeit im Doku-Repo)</li><li>Vorstellung des Imports der Statitsik-MDBs (Marcel)</li><li>Beauftragung WebDAV/CalDAV/VUE.js (Zusammenarbeit mit Firmen)</li><li>Beauftragung PHP-Notenmodul (?)</li><li>Erstellung Konzept Gruppenprozesse (Beauftragung Design?)</li><li>Diskussion Benutzerrechte (Analyse Benutzerrechte in Schild2.0)</li></ol><h1 id="erlauterungen" tabindex="-1">Erl\xE4uterungen <a class="header-anchor" href="#erlauterungen" aria-hidden="true">#</a></h1><p>Zu einigen Punkten weitere Erkl\xE4rung</p><p>Zu 3) Es sollte im Team besprochen werden, was die Pl\xE4ne f\xFCr die n\xE4chste Zeit sind und welche Schritte in welcher Reihenfolge geplant sind, damit die Entscheidungen transparenter werden und auch besser diskutiert werden kann.</p><p>Zu 9) und 10) Wir haben die M\xF6glichkeit \xFCber d-NRW relativ gro\xDFe Auftr\xE4ge zu vergeben. Hier stellt sich die Frage, was f\xFCr Leistungen man dort ausschreibt. Wichtig ist, dass wir andere Firmen einarbeiten m\xFCssen, ohne unsere Kapazit\xE4ten zu sehr zu belasten. Au\xDFerdem muss ein Bereich gefunden werden, der unsere Arbeit nicht in die Quere kommt, wenn viel Code eingecheckt wird. Aus diesem Grund wurde ein Themenbereich gesucht, der schulfachlich komplett ohne Vorkenntnisse durchgef\xFChrt werden kann. Hier kam die Idee auf eine WebDAV-Server in unser Projekt einprogrammieren zu lassen, der dann CardDAV und CalDAV-Prozesse \xFCbernehmen kann. Wir wollen sp\xE4ter eh einen Kalender und Adressbuchservice bieten. Man k\xF6nnte die Zusammenarbeit testen und dann ggf. weitere Schritte gehen. Bei VUE.js (was wir im selben Auftrag haben) k\xF6nnten wir die Analyse des Projektes und Verbesserungen und Fehlerbehebung in Auftrag geben. Hier k\xF6nnte Bern im Optimalfall Beratungsleistung bei VUE.js bekommen.</p><p>Zu 10) Es gibt auch die M\xF6glichkeit PHP zu beauftragen. Wir suchen immer noch nach einer L\xF6sung, wie unsere Applikationen sicher im Internet zur Verf\xFCgung gestellt werden k\xF6nnen, ohne dass die Schule den SVWS-Server offen im Netz stehen haben muss. Eine PHP-APP, die Noteneingabe und LuPO erm\xF6glicht und dann mit dem SVWS-Server synchronisiert war eine Idee.</p>',8),s=[a];function d(u,l,o,h,g,c){return r(),n("div",null,s)}var b=e(t,[["render",d]]);export{p as __pageData,b as default};
